import React from "react";
import {useHistory} from 'react-router-dom';

import '../style.css';

const MainPage = () => {
  const history = useHistory();

  return(
    <>
      <header>
        <div className="navbar">
          <h1 className="navbar-title">Main Page</h1>
        </div>
      </header> 
      <main>
        <section className="router-section">
          <a href="#" className="router-link">Registration</a>
          <a href="#" className="router-link">Sign In</a>
          <a href="#" className="router-link">User Info</a>
          <a  className="router-link">
            About App
          </a>
          <a href="#" className="router-link">Calculator</a>
        </section>
      </main>
    </>
  )
};

export default MainPage;
